import React from "react";
import Header from "../layouts/Header";

const CartPage = ({cartCount}) => {
    return (
        <>
            <Header
                cartCount={cartCount} />
            <main className="p-8">
                <h1 className="text-3xl mt-4 mb-3">My Cart</h1>

                <div className="my-2 bg-white border-slate-800">Test</div>
            </main>
        </>
    )
};

export default CartPage;
